INSERT INTO `tb_news` VALUES ('1', '家政行业乱象频生亟待规范', '&nbsp;&nbsp;&nbsp;&nbsp;家政行业的混乱，早已不是什么新闻了。有的雇主甚至换了几十个保姆都不满意。除了雇主挑剔之外，家政行业自身缺乏规范管理等等，也给家政服务业的发展蒙上了阴影。据统计，在全市的600多家家政企业中，450多家提供月嫂服务。但真正具备资质的家政企业，实际上只有40家左右，占行业总数15%。浑水摸鱼的比例非常高。业内人士所说的证书，就是由全国劳动保障部统一颁发的家政服务人员上岗资格证书。家政行业工作人员，需要经过培训并通过认证考试后，获取上岗资格证才能从事相关的家政服务工作。而要从普通保姆逐渐上升到金牌月嫂，则至少需要5年的时间。', '2014-03-28', '行业新闻');
INSERT INTO `tb_news` VALUES ('2', '手机淘宝推出家政服务平台 7万名阿姨实名入驻', '&nbsp;&nbsp;&nbsp;&nbsp;昨日，手机淘宝宣布正式推出便捷可靠的家政服务平台——生活家。首批开通北京、上海、广州、深圳、杭州、武汉、天津、太原、西安、运城、吉林、济南、南通、绵阳、自贡15个城市，7万名家政阿姨实名认证入驻手机淘宝。通过手机淘宝APP下单，只需30秒，就能找到经过正规培训的阿姨，为你提供家政上门服务。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;现在用手机淘宝服务平台找阿姨，生活家可通过支付宝首创的担保交易服务，为买卖双方提供一个担保账户，遵循买家付款-卖家发起服务-买家得到服务确认付款的流程，保障买卖双方交易安全，防范欺诈。此外，入驻“生活家”平台的商家也已购买家政保险，如家政阿姨不小心损坏家里的物品，用户也可以申请保险公司介入赔付。', '2014-03-27', '行业新闻');
INSERT INTO `tb_news` VALUES ('3', '高三女难伺候月换仨保姆', '&nbsp;&nbsp;&nbsp;&nbsp;上周，宁女士已经从单位请了假专门回家照顾要参加高考的女儿。宁女士说，女儿的口味变得很挑剔，在这一个月当中已经为女儿换了仨保姆，但没一个让女儿满意的。\n宁女士家住沙河口区星海湾街道化物所社区，昨日她无奈地到社区请求帮忙寻找家政人员。这让社区工作人员很是奇怪，因为在一个月当中，宁女士家已经换了3个保姆了，每位保姆都是干不到一周就走人了，这是怎么回事?<br><br>&nbsp;&nbsp;&nbsp;&nbsp;原来，宁女士的女儿今年高三，马上就要参加高考，压力很大，本不挑食的孩子不知怎的口味也变得挑剔起来了。由于宁女士和丈夫平时工作都很忙，有时甚至晚上要加班到很晚，不能很周全地照顾孩子的日常起居。“作为父母，都想在这段时间给孩子一个优越的生活和学习环境。”所以宁女士打算给孩子请个“高考保姆”，专门负责给孩子做可口的饭菜。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;因为孩子现在用脑过度，只有在日常生活中更好地补充营养，才能减轻她一部分的压力，能够更好地学习。但事与愿违，每个阿姨到她家工作了不到一周就提出辞职，在宁女士的再三追问下，一个保姆终于道出了实情：“你家孩子太难伺候了，做什么也不爱吃还乱发脾气，我干不了。”', '2014-03-28', '行业新闻');
INSERT INTO `tb_news` VALUES ('4', '山东开创巾帼家政服务新局面 推动家政服务标准化', '&nbsp;&nbsp;&nbsp;&nbsp;据山东广播电视台新闻中心《山东新闻联播》报道，全国妇联贯彻落实习近平总书记重要指示精神加快巾帼家政服务健康发展推进会今天在济南召开。全国人大常委会副委员长、全国妇联主席沈跃跃出席会议并讲话。\n中央有关部门负责同志宋秀岩、喻红秋、邱小平、房爱卿；省领导高晓兵、于建成出席会议。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;沈跃跃强调，各级妇联、巾帼家政服务机构要以贯彻落实习近平总书记重要指示精神为指针，积极推进巾帼家政服务职业技能培训、标准化建设、诚信体系建设和品牌化发展等工作，切实加强对巾帼家政服务工作的指导，积极探索公益型服务与市场化运作相结合的有效发展模式，创建具有地域特点、妇联特色的家政服务品牌，引导巾帼家政服务企业向规模化、专业化发展。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;高晓兵在致辞时说，在全国妇联的关心指导下，山东妇联组织把发展家政服务作为帮扶下岗女职工、进城务工妇女的重要途径，逐步培育起一批实力较强的家政服务企业，打造了“大姐”服务品牌，有力推动了全省家政服务业的职业化、标准化、产业化发展。我们将认真学习贯彻会议精神，努力开创山东巾帼家政服务和妇女工作新局面。', '2014-03-29', '行业新闻');
INSERT INTO `tb_news` VALUES ('5', '云家政：家政行业的“洋气”玩法', '&nbsp;&nbsp;&nbsp;&nbsp;家政难找是很多地方出现的一种通病，从报纸广告到实体中介再到同城网站，虽有海量信息但难以筛选出合适的一个。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;在云家政联合创始人孙黎看来，家政信息缺乏系统的管理是难以找到合适家政的一个重要原因。“通常是家政阿姨做了一定的时间后，就开始自己开中介，很多人甚至都不太会记账，更难管理手下的家政阿姨。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;而也正是这一现状，使得家政O2O平台成为孙黎等年轻创业者的创业切入点。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;恰巧在2009年，上海市家政协会提出了“家政数据库”的构想，需要采集家政服务人员的信息，从而进行家政身份认证和中介监管。云家政团队便以此为契机，与家政协会达成合作意向，为其免费开发家政人员的管理系统。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;综合云家政的发展轨迹，可以将其分为两个阶段，在2013年以前，云家政所扮演的角色更像是针对家政公司的技术方案解决商。将系统推广给家政中介，教会其使用该系统管理阿姨信息、查找订单、记账等功能，并进行定期维护。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;直到2013年，在接入的家政人员达到一定的数量后，该团队正式上线了“云家政”网站，开始为个人消费者提供找家政的服务。据了解，目前云家政的业务主要包括保洁、育儿、看护、月嫂、保姆等几大类。用户可以像逛淘宝一样在上面挑选家政阿姨和家政公司，然后下单预约，最后再进行信用评价。在整个交易完成之后，云家政会从中抽取一定的佣金。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;由于一线城市和二线城市的家政市场有很大的不同，他们在推广中设定了两种运营方案。孙黎表示，北上广一线城市家政的中介没有龙头企业，规模相差不大，因此更容易推进淘宝模式。“中介公司在云家政上自己经营，提升自己的品牌和信用，我们从中抽取佣金。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;而在二线城市中已经存在那种规模大的家政公司，这时候云家政更多的以软件供应商的身份和他们合作。“家政公司愿意接受我们的系统，因为很多公司都还没有进行信息化管理，他们在使用我们的软件的同时，家政人员的信息也会进入到我们的数据库里。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;据孙黎介绍，目前云家政在上海已经接入了400家家政公司，大约覆盖了55000名家政人员。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;除了云家政之外，从去年开始也陆续出现了95081、e家洁、阿姨帮、阿姨来了等多家家政平台。大多数的家政服务平台本地性明显，全国性覆盖尚未出现。在家政8400亿的市场规模之下，家政O2O被视为新的创业掘金点。', '2014-03-30', '行业新闻');
INSERT INTO `tb_news` VALUES ('6', '日本一2岁儿童死亡 或因遭保姆遗弃', '&nbsp;&nbsp;&nbsp;&nbsp;据台湾“中央社”3月17日报道，日本警方17日上午在埼玉县一处公寓发现一2岁男童尸体，另一名8个月大的男婴在一旁大哭。据报道，这两名孩子是由他们母亲此前通过保姆中介网站托给一名20多岁的男子照顾。当地警方怀疑该男子涉嫌遗弃男童，并已向其下发逮捕令。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;当地警方表示，孩子的母亲住在横滨市矶子区，16日下午5时向警方报案称与保姆失去联系”。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;据报道，她是在14日通过保姆中介网站，以电子邮件约定与对方当晚见面。警方说，当晚接走小孩的是30多岁男子，之后男子在横滨车站，把小孩交给和妈妈通电邮的20多岁男子。双方原约好16日带回男童与男婴，却迟迟无法联系到保姆。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;当地警方循线追查，17日上午在20多岁男子住处发现身上有瘀青的2岁男童尸体。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;据报道，“保姆网站”首页刊登消息称，只要支付入会费，即可通过中介选择照顾孩童的保姆，服务项目包括幼儿园接送、病童照顾或过夜住宿托儿等。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;男童母亲先前也曾通过这个网站托儿，但这是首次托儿给一名20多岁男子，也不知对方的本名、住址。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;日本厚生劳动省指出，在特定地方接受托儿，需根据儿童福祉法接受指导及监督，如果接受托儿的人数逾6人，必须向地方政府提出申请。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;埼玉县少子政策课表示，之前并不清楚17日警方发现男童尸体的地方是托儿所。富士见市公所职员也说，看到媒体报道才惊觉这里有托儿所。', '2014-03-18', '网站公告');
INSERT INTO `tb_news` VALUES ('11', '意大利研发机器人保姆 可全天候监测独居老人健康状况', '&nbsp;&nbsp;&nbsp;&nbsp;随着我国社会老龄化程度的加深，现如今，空巢老人是越来越多，这已经成为一个不容忽视的社会问题。很多子女婚后工作繁忙无暇照顾老人，而聘请专职保姆又会无形之中增加经济负担。如何解决这个两难的问题呢？最近，意大利国家科研委员会研发出一种机器人保姆，有望改善独居老人的日常起居和健康生活。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;这款由欧盟资助开发的机器人保姆，旨在建立独居老人与陪护、医疗中心之间的桥梁。目前，这一项目已经进入测试阶段，而意大利一位94岁高龄的老奶奶就是它的受益者。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;莱娅·米娜·拉利是一名女诗人，而且还是名狂热的网络博客写手。尽管她今年已经94岁高龄了，可依然独自居住在意大利罗马的一间公寓里。平日里，老奶奶的家人和朋友很少能抽出时间来陪伴她。可老奶奶并不觉得孤单，因为她有“罗宾先生”的悉心照料和陪伴。老奶奶口中的 “罗宾先生”就是目前正在欧洲许多国家进行测试的远程操控监测机器人。它不但负责24小时全天候的监控莱娅的健康状况，事实上也是连接莱娅与外界的沟通工具。无论是与家人视频聊天还是向医生咨询病情，通过这款机器人都可以轻松完成。说到终日陪伴她的“罗宾先生”，莱娅很是兴奋，并且称它为伴侣：“我很高兴他们能选我参与这个项目，我觉得这非常有趣。尽管这款机器人还不是很完善，并且有些地方需要改进，但总体上它已经是一个非常好的伴侣了。因为我知道，如果我发生什么意外，比如跌倒或昏厥，我都可以通过遥控设备向外界呼救。当我按下机器人身上的绿色按钮，就可以和医生视频，这样他们就不用从家中赶来为我诊治了。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;“罗宾先生”监测机器人是由欧盟资助的GiraffPlus项目的一部分，立志在用户和医疗陪护中心建立一个良好的沟通桥梁，并且通过远程操控机器人，为家中需要照顾的老年人提供交流与沟通服务。项目技术中心的经理加布里埃尔阐释了机器人的工作原理：“机器人顶部装有一个ＬＥＤ显示屏以及扬声器，内置的传感器来收集检测用户的各项生理数据，比如血压，血糖、体温等等，而分布在房间各个角落的外置传感器还可监测老人居住的房间是否出现煤气泄露、漏水漏电、外人闯入等危险状况，堪称一名称职的贴身保姆。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;来自健康中心的负责经理马塞洛认为，“罗宾先生”这类的监测机器人可以很大程度上减缓医疗中心的日常工作：“这种高科技产品对我们的工作真是极大的帮助。我们所要做的只是收集病患的信息并建立一个数据库。有了这个机器人，就可以全天候的了解病人的状况了。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;目前，这款机器人正在意大利、西班牙和瑞典进行测试，经过改进之后，有望于2015年投入大规模商业生产，相信不久的未来，您的家里也会出现这样一位贴心的机器人保姆吧。', '2014-06-04', '行业新闻');
INSERT INTO `tb_news` VALUES ('12', '美国一家人来华寻找11年前中国保姆', '&nbsp;&nbsp;&nbsp;&nbsp;美国人Blackley女士即将再次来到北京，除了旧地重游，他们还很想寻找一位“亲人”。她叫李金玲，14年前曾在他们家当保姆，双方建立了深厚的感情，后来失去联系。天津的邻居说，李金玲早已经在一年前搬到了北京居住。因此，Blackley女士很想在北京找到李金玲，和她见见面，聊聊过去十多年她们已经错过的时光。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;Blackley女士在邮件里告诉记者，2000年9月，由于丈夫来到天津工作，她带着4岁的女儿Eliza和18个月大的儿子Aaron，搬到了天津。在陌生的国度里，从零开始,置办起一个家，并不容易，更何况当时他们只会说一点点中文。不过，保姆李金玲的到来，改变了一切。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;“从一开始，李阿姨就帮了我们太多的忙，”Blackley女士说，当年他们东奔西走地采购家具，两个孩子经常不耐烦会哭闹。可是，李金玲来了后，以她温和的性格和温暖的笑容，很快就征服了两个孩子。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;Blackley女士说，李金玲是一个瘦高个儿，今年大概60岁出头。李金玲在他家当了3年多的阿姨，直到2003年10月，他们举家回美国，才不得不分离，“而告别的那一天，我们都流了很多眼泪。”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;在Blackley女士的印象中，李金玲乐观开朗，一直在勤勤恳恳地工作，从来没有不高兴的时候。每个礼拜，李金玲都会下厨，为全家人包饺子。“当时我们全家人都很喜欢围在桌子旁边，看着她将面团擀成皮，然后把馅塞进去捏紧……”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;最让Blackley感动的是，李金玲很爱她的两个孩子。姐弟俩至今都清楚地记得，他们和李阿姨相处的欢乐时光。原来，当年李金玲经常陪两个孩子玩耍，让他俩在一张白纸上，描出她的手。有时两个孩子故意在纸上把她的手描得很大，这时李金玲总会笑着“抗议”，逗得两个孩子哈哈大笑。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;在孩子们看来,即使李金玲用纸简简单单地折出来一只天鹅，都能让他们高兴。值得一提的是，小儿子Aaron特别喜欢让李阿姨抱着他，李金玲也很喜欢小家伙，即使在打扫卫生时，也舍不得把小家伙放下来。虽然李金玲只懂一点点英语，但她总是忍不住用英语夸奖小家伙：“You are so clever! (你真是太聪明了!)”<br><br>&nbsp;&nbsp;&nbsp;&nbsp;Blackley女士说，他们全家将在今天来到中国，首先在天津待几天和老朋友聚一聚，然后再来北京登一登长城，看一看紫禁城，逛一逛胡同。虽然这些地方，孩子以前都去过了，但那个时候他俩岁数还小,更何况家里添了第三个孩子，名叫Amanda,今年5岁了。<br><br>&nbsp;&nbsp;&nbsp;&nbsp;说到这里，Blackley笑了。她说，李金玲应该还不知道她有了第三个孩子，所以她经常想象当李金玲见到这个“小不点”时，该有多么高兴和吃惊！<br><br>&nbsp;&nbsp;&nbsp;&nbsp;Blackley说，这些天她一直在祈祷能早点找到李金玲,“如果此行见不到李阿姨，我们全家都会觉得很心痛。”', '2014-06-11', '行业新闻');

